export class F1APIService {
    getSeasonInfo() {
        return new Promise(
            (resolve, reject) => {
                fetch('https://ergast.com/api/f1/2019.json')
                .then(res => res.json)
                .then(seasonInfo => {
                    resolve(seasonInfo.items)
                })
                .catch(err => { 
                    console.error(err) 
                    reject("Erro ao buscar API")
                })
            }
        )
    }
}
